import React, {useState} from 'react'
import './Slider.css'
//import BtnSlider from './BtnSlider'
import dataSlider from './dataSlider'

function Slider() {
    return (
        <div >
            {dataSlider.map((obj, index) =>{
                return (
                    <div>
                        <img
                        src={process.end.PUBLIC_URL + `/Imgs/img${index +1}.jpg`}
                        />
                    </div>
                )
            })}
        </div>
    )
}

export default Slider
